import React from "react";
import "./Home.css";

function Home() {
    return (
        <div id="home">
            <div id="home-text">
                <h1>Hi, I'm <span id="name">John Doe</span></h1>
                <h2>Software Developer</h2>
                <p>
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. 
                    Nullam nec purus ut libero ultricies iaculis. 
                    Nulla facilisi. 
                    Nullam nec purus ut libero ultricies iaculis. 
                    Nulla facilisi.
                </p>
            </div>
            <div id="home-image">
                <img src="https://via.placeholder.com/300" alt="John Doe" />
            </div>
        </div>
    );
}

export default Home;
